  <div>
    <img :src="src"
      alt="">
    <button @click="pushImgToArrays">点击</button>
  </div>
</template>

<script>
import { toByteArray, fromByteArray } from '../libs/base64';
export default {
  name: 'image',
  data () {
    return {
      src: '',
      a:"",
      b:"",
      c:"",
      d:"",
    }
  },
  computed: {
  },
  watch: {},
  methods: {
    pushImgToArrays () {
        let arr = [toByteArray(this.c), toByteArray(this.d)];
        this.src = 'data:image/jpg;base64,' + fromByteArray(arr); // 得到base64路径
        console.log(this.src);
    },
  },
  mounted () { },
  components: {}
}
</script>

